wakeLock.description:
Will wake up the device for the given time (in milliseconds) when the notification is shown.
The application needs to also set the <code>android.permission.WAKE_LOCK</code> permission
in the Android manifest section of the <code>tiapp.xml</code> file.
<pre><code class="language-xml">&lt;ti:app&gt;
    &lt;android&gt;
        &lt;manifest&gt;
            &lt;uses-permission android:name=&quot;android.permission.WAKE_LOCK&quot; /&gt;
        &lt;/manifest&gt;
    &lt;/android&gt;
&lt;/ti:app&gt;
</code></pre>
